Mosaic.addPlugins([require('/Users/amitsharma/development/mosaic-tutorials/mosaic-101/packages/sample-extension/src/plugin/App.plugin.js')]);
import logo from './logo.svg';
import './App.css';

/** @namespace App/App */
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
